import Home from '../components/home';

export default () => (
  <div>
    <Home />
    <style jsx>{`
        .App {
          text-align: left;
          margin: 30px;
        }
        .flex{
        justify-content: space-around;
        display: flex;
        }
        ul{
          padding: 0px;
        }
        li{
          list-style-type: none;
          margin-bottom: 20px;
        }
        a{
          text-decoration: none;
          color: black;
        }


      `}</style>
  </div>
);
